import Layout from "./layout";
import TextField from "@material-ui/core/TextField";
const Index = () => {
  return (
    <Layout>
      <div>
        <p>Hello Next.js</p>
        <form noValidate autoComplete="off">
          <TextField
            style={{ width: "100%" }}
            id="outlined-basic"
            label="Username"
            variant="outlined"
          />
          <TextField id="outlined-basic" label="Password" variant="outlined" />
        </form>
      </div>
    </Layout>
  );
};

export default Index;
